import { AxiosInstance } from "../../Network/AxiosInstance"

export const addMovies = (page) => async (dispatch)=>{
   try {
        const res = await AxiosInstance.get(`/movie/popular?&page=${page}`)
        dispatch({
            type: "GET_MOVIES",
            payload: res.data.results
        })
    } catch (err) {
        return console.log(err)
    }
}
